sample: '["\"Detta fina 4-stj\u00e4rniga frukosthotell \u00e4r ideellt bel\u00e4get
  endast 100 meter fr\u00e5n Pardatschgratbanan.\\nHotellet erbjuder fina rum med
  m\u00f6jlighet f\u00f6r 1 - 2 extra b\u00e4ddar. Det \u00e4r inkluderat en l\u00e4cker
  frukostbuff\u00e9, som bl.a. bjuder p\u00e5 ekologiska produkter.\\nHusets erbjuder
  ocks\u00e5 ett wellnessomr\u00e5de med finsk bastu, fotbad, solarium, massage och
  avslappningsrum.\\nDet \u00e4r gratis internet i receptionsomr\u00e5det samt parkeringsplats
  vid huset eller i garage. Det \u00e4r dock begr\u00e4nsade platser i garaget.\\nVi
  erbjuder f\u00f6ljande rumstyper:\\n3 personers rum\\nFint och rymligt 3-s\u00e4ngsrum
  med bad/toalett, h\u00e5rtork, tv, radio, telefon, safe, mini-bar, balkong eller
  terrass. I rummet finns dubbels\u00e4ng samt b\u00e4ddsoffa.\\nDubbelrum\\nFint
  och rymligt dubbelrum med bad/toalett, h\u00e5rtork, tv, radio, telefon, safe, mini-bar,
  balkong eller terrass.\\nV\u00e4lj ett datum f\u00f6r att se pris\u00f6versikt\\nKom
  ih\u00e5g att alla Danski''s priser \u00e4r inklusive ett 6-dagars lokalt liftkort
  till vuxen. Ifall du s\u00f6ker p\u00e5 r\u00e4tt \u00e5lder visas det riktiga priset
  automatiskt. I tabellen kan du se vilka rabatter eller till\u00e4gg som finns, i
  f\u00f6rh\u00e5llande till \u00e5lder, l\u00e4ngd och ut\u00f6kning av liftkort.\\nV\u00e4lj
  ett datum f\u00f6r att se pris\u00f6versikt\\nM\u00e5ndag: 09:00 - 18:00\\nTisdag:
  09:00 - 18:00\\nOnsdag: 09:00 - 18:00\\nTorsdag: 09:00 - 18:00\\nFredag: 09:00 -
  16:30\\nL\u00f6rdag och S\u00f6ndag har vi st\u00e4ngt.\\nFyll i f\u00e4lten nedan
  och vi kommer att ringa dig s\u00e5 snart som m\u00f6jligt\\nFyll i f\u00e4lten
  nedan och vi kommer att svara dig via e-post s\u00e5 snart som m\u00f6jligt\"",
  "\"Ett \u00f6verg\u00e5ende beroende i en databas \u00e4r ett indirekt f\u00f6rh\u00e5llande
  mellan v\u00e4rden i samma tabell som orsakar ett funktionellt beroende. F\u00f6r
  att uppn\u00e5 normaliseringsstandarden f\u00f6r Third Normal Form (3NF) m\u00e5ste
  du eliminera alla transitiva beroenden. Enligt sin natur kr\u00e4ver ett \u00f6verg\u00e5ende
  beroende tre eller flera attribut (eller databaskolumner) som har ett funktionellt
  beroende mellan sig, vilket inneb\u00e4r att kolumn A i en tabell f\u00f6rlitar
  sig p\u00e5 kolumn B genom en mellanliggande kolumn C. L\u00e5t oss se hur detta
  kan fungera.\\nExempel p\u00e5 transitivt beroende\\nF\u00d6Rfattare\\nI AUTHORS-exemplet
  ovan:\\n- Bok \u2192 F\u00f6rfattare: H\u00e4r, den bok attribut best\u00e4mmer
  F\u00f6rfattare attribut. Om du k\u00e4nner till boknamnet kan du l\u00e4ra dig
  f\u00f6rfattarens namn. I alla fall, F\u00f6rfattare best\u00e4mmer inte bok, eftersom
  en f\u00f6rfattare kan skriva flera b\u00f6cker. Till exempel bara f\u00f6r att
  vi vet att f\u00f6rfattarens namn \u00e4r Orson Scott-kort, vi vet fortfarande inte
  boknamnet.\\n- F\u00f6rfattare \u2192 F\u00f6rfattare_nationalitet: Likas\u00e5
  F\u00f6rfattare attribut best\u00e4mmer F\u00f6rfattare_nationalitet, men inte tv\u00e4rtom
  \u2013 bara f\u00f6r att vi vet att f\u00f6rfattarens nationalitet betyder inte
  att vi kan best\u00e4mma f\u00f6rfattaren.\\nMen den h\u00e4r tabellen introducerar
  ett \u00f6verg\u00e5ende beroende:\\n- Bok \u2192 F\u00f6rfattare_nationalitet:
  Om vi k\u00e4nner till boknamnet kan vi best\u00e4mma f\u00f6rfattarens nationalitet
  via f\u00f6rfattarkolumnen.\\nUndvik transitiva beroenden\\nF\u00f6r att s\u00e4kerst\u00e4lla
  tredje normala formen, l\u00e5t oss ta bort det transitiva beroendet. Vi kan b\u00f6rja
  med att ta bort bokkolumnen fr\u00e5n f\u00f6rfattartabellen och skapa en separat
  b\u00f6ktabell:\\nB\u00d6CKER\\nF\u00d6Rfattare\\nFixade det det? L\u00e5t oss unders\u00f6ka
  v\u00e5ra beroenden nu:\\nBOKA-tabellen:\\n- Book_ID \u2192 Book: De bok beror p\u00e5
  Book_ID.\\n- Inga andra beroenden i denna tabell finns, s\u00e5 vi \u00e4r okej.
  Observera att den fr\u00e4mmande nyckeln, F\u00f6rfattare_ID, l\u00e4nkar denna
  tabell till tabellen F\u00d6RFATTARE genom dess prim\u00e4ra nyckel F\u00f6rfattare_ID.
  Vi har skapat en relation f\u00f6r att undvika ett \u00f6verg\u00e5ende beroende,
  en nyckeldesign f\u00f6r relationsdatabaser.\\nF\u00d6RFATTARE bord:\\n- F\u00f6rfattare_ID
  \u2192 F\u00f6rfattare: Den F\u00f6rfattare beror p\u00e5 F\u00f6rfattare_ID.\\n-
  F\u00f6rfattare \u2192 F\u00f6rfattare_nationalitet: Nationaliteten kan best\u00e4mmas
  av f\u00f6rfattaren.\\n- F\u00f6rfattare_ID \u2192 F\u00f6rfattare_nationalitet:
  Nationaliteten kan best\u00e4mmas fr\u00e5n F\u00f6rfattare_ID genom F\u00f6rfattare
  attribut. Vi har fortfarande ett \u00f6verg\u00e5ende beroende.\\nVi m\u00e5ste
  l\u00e4gga till en tredje tabell f\u00f6r att normalisera dessa data:\\nL\u00c4NDER\\nF\u00d6Rfattare\\nNu
  har vi tre tabeller, som anv\u00e4nder fr\u00e4mmande nycklar f\u00f6r att l\u00e4nka
  mellan tabellerna:\\n- BOOK-tabellens utl\u00e4ndska nyckel, F\u00f6rfattare_ID,
  l\u00e4nkar en bok till en f\u00f6rfattare i tabellen F\u00d6Rfattare.\\n- AUTHORS-tabellens
  utl\u00e4ndska nyckel, Land_ID, l\u00e4nkar en f\u00f6rfattare till ett land i COUNTRIES-tabellen.\\n-
  L\u00c4NDER-tabellen har ingen fr\u00e4mmande nyckel eftersom den inte beh\u00f6ver
  l\u00e4nka till en annan tabell i denna design.\\nVarf\u00f6r transitiva beroenden
  \u00e4r d\u00e5lig databasdesign\\nVad \u00e4r v\u00e4rdet av att undvika transitiva
  beroenden f\u00f6r att s\u00e4kerst\u00e4lla 3NF? L\u00e5t oss \u00f6verv\u00e4ga
  v\u00e5rt f\u00f6rsta bord igen och se de problem det skapar:\\nF\u00d6Rfattare\\nDenna
  typ av design kan bidra till dataavvikelser och inkonsekvenser, till exempel:\\n-
  Om du har tagit bort de tv\u00e5 b\u00f6ckerna Mind of Children och Enders spel,
  du skulle ta bort f\u00f6rfattaren \u201dOrson Scott Card\u201d och hans nationalitet
  helt fr\u00e5n databasen.\\n- Du kan inte l\u00e4gga till en ny f\u00f6rfattare
  i databasen om du inte ocks\u00e5 l\u00e4gger till en bok. Vad h\u00e4nder om f\u00f6rfattaren
  \u00e4nnu inte har publicerats eller om du inte vet namnet p\u00e5 en bok de f\u00f6rfattat?\\n-
  Om \u201dOrson Scott Card\u201d \u00e4ndrade sitt medborgarskap skulle du beh\u00f6va
  \u00e4ndra hans medborgarskap i alla register d\u00e4r han f\u00f6rekommer. Att
  ha flera poster med samma f\u00f6rfattare kan resultera i felaktiga uppgifter. Vad
  h\u00e4nder om datainmatningspersonen inte inser att det finns flera poster f\u00f6r
