  som kedjan Jula s\u00e4ljer under sitt eget m\u00e4rke Anslut ocks\u00e5 f\u00f6rekommit
  under namn s\u00e5som Foma, Pioneer, . Kollektivtrafik Gatuvy Mer info. Uppt\u00e4ck
  Jula n\u00e4rmast dig! Bl\u00e4ddra bland kataloger, reklamblad och erbjudanden.\\nF\u00e5
  \u00e4ven tillg\u00e5ng till butiksinformation.\"", "\"Sveriges st\u00f6rsta drivmedelsbolag
  Preem tar nu bort RME-inneh\u00e5llet i Preem Evolution Diesel och ers\u00e4tter
  med HVO. D\u00e4rmed har dieseln som tidigare kategoriserades som en B7-diesel uppgraderats
  till en diesel med B0-egenskaper. F\u00f6r svenska transportsektorn inneb\u00e4r
  detta en diesel som \u00e4r b\u00e4ttre anpassad f\u00f6r kallt klimat och har b\u00e4ttre
  lagringsbarhet vilket ger en h\u00f6gre kvalit\u00e9 p\u00e5 dieseln.\\n\u2013 V\u00e5ra
  kunder efterfr\u00e5gar en diesel utan RME. Vi \u00e4r d\u00e4rf\u00f6r glada \u00f6ver
  att nu kunna f\u00f6rb\u00e4ttra Preem Evolution Diesel med HVO i st\u00e4llet f\u00f6r
  RME, som h\u00e5ller en h\u00f6gre teknisk prestanda. Det h\u00e4r \u00e4r ytterligare
  bevis p\u00e5 att Preem forts\u00e4tter f\u00f6rb\u00e4ttra produktutbudet, samtidigt
  som drivmedlet forts\u00e4tter ha l\u00e4gre koldioxidutsl\u00e4pp \u00e4n helt
  fossil diesel, s\u00e4ger Thom Sandell, ansvarig f\u00f6r Preems produkterbjudanden.\\nB7-diesel
  inneh\u00e5ller FAME och introducerades i svensk standarddiesel 2006 som ett s\u00e4tt
  att minska de fossila koldioxidutsl\u00e4ppen. I Sverige anv\u00e4nds FAME baserad
  p\u00e5 raps (RME) p\u00e5 grund av dess k\u00f6ldegenskaper. Inblandningen av RME
  inneb\u00e4r att br\u00e4nslet l\u00e4ttare tar till sig vatten. Det i kombinationen
  med att RME \u00e4r biologiskt nedbrytbar g\u00f6r att B7-diesel har l\u00e4ttare
  f\u00f6r att f\u00e5 tillv\u00e4xt av bakterier som kan f\u00f6rorsaka driftproblem
  f\u00f6r fordon.\\nFlera produktf\u00f6rdelar med uppgraderade Preem Evolution Diesel\\nMed
  Preems byte fr\u00e5n RME till HVO f\u00e5r kunderna nu en diesel med b\u00e4ttre
  k\u00f6ldegenskaper. Den egenskapen, tillsammans med samma lagringsbarhet som fossil
  diesel och ett \u00f6kat energiinneh\u00e5ll, g\u00f6r att Preem Evolution Diesel
  kommer underl\u00e4tta f\u00f6r den svenska transportsektorn och dess fordon.\\nDet
  inneb\u00e4r att Preem Evolution Diesel har f\u00f6rdelar j\u00e4mf\u00f6rt med
  annan diesel som inneh\u00e5ller RME, s\u00e4rskilt f\u00f6r de som k\u00f6r fordon
  i l\u00e5ga temperaturer eller har en tank som st\u00e5r oanv\u00e4nd under l\u00e4ngre
  perioder och riskerar att f\u00e5 kondensvatten i tanken. Det kan r\u00f6ra sig
  om s\u00e4songsbaserade fordon som traktorer, b\u00e5tar och privatbilister som
  k\u00f6r v\u00e4ldigt s\u00e4llan.\\n\u2013 Det finns en rad missuppfattningar om
  att alla dieseltyper med f\u00f6rnybar inblandning fungerar likadant, men det st\u00e4mmer
  inte. Preems f\u00f6rb\u00e4ttrade Preem Evolution Diesel \u00e4r kemiskt identisk
  med fossil diesel. \u00c4ven om vatten skulle f\u00f6rekomma i tanken, \u00e4r tillv\u00e4xten
  av mikroorganismer betydligt sv\u00e5rare i b\u00e5de fossil diesel och HVO. Jag
  \u00e4r \u00f6vertygad om att detta kommer gynna v\u00e5ra kunder som f\u00e5r ett
  st\u00e4rkt v\u00e4rdeerbjudande, avslutar Thom Sandell.\\n\u00d6ver 200 av Preems
  stationer har redan f\u00e5tt den nya produkten, och vi utreder m\u00f6jligheter
  att ut\u00f6ka tillg\u00e4ngligheten med m\u00e5lbild om att samtliga stationer
  ska f\u00e5 den nya uppgraderade Preem Evolution Dieseln. Dieseln \u00e4r en diesel
  av svensk standardkvalit\u00e9 vilket bland annat inneb\u00e4r att det inte beh\u00f6vs
  n\u00e5got speciellt tillst\u00e5nd fr\u00e5n fordonstillverkarna. Alla motorgarantier
  g\u00e4ller precis som vanligt och inga nya servicerutiner beh\u00f6vs.\\nEgenskaper
  Diesel B7 avser att produkten inneh\u00e5ller upp till sju procent FAME och i Sverige
  anv\u00e4nds FAME baserad p\u00e5 raps, d\u00e5 kallad RME. Detta \u00e4r ett f\u00f6rsta
  generationens biodrivmedel som i huvudsak har vegetabiliska oljor som r\u00e5vara.\\nEgenskaper
  Diesel B0 \u00e4r en diesel utan RME (rapsmetylester), \u00e4ven kallad \u201dblankdiesel\u201d.
  Uppdateringen av Preem Evolution Diesel inneb\u00e4r att det dess egenskaper \u00e4r
  mer att likna vid en s\u00e5 kallad B0-diesel med inblandning av HVO som \u00e4r
  en v\u00e4tebehandlad f\u00f6rnybar olja som kemisk \u00e4r i stort sett identiskt
  med fossil diesel. Exempelvis kan r\u00e5varor som tallolja och restprodukter fr\u00e5n
  livsmedelsindustrin processas vidare med v\u00e4tgas under inverkan av en katalysator
  f\u00f6r att bli ett drivmedel f\u00f6r dieselmotorer.\\nF\u00f6r mer information
  kontakta\\nPreems pressjour\\n070-450 10 01\\npress@preem.se\\nPREEM \u00e4r Sveriges
  st\u00f6rsta drivmedelsbolag. V\u00e5r vision \u00e4r att leda omvandlingen mot
  ett h\u00e5llbart samh\u00e4lle. Senast 2035 ska Preem producera 5 miljoner kubikmeter
  f\u00f6rnybara drivmedel och vara klimatneutrala i hela v\u00e4rdekedjan. Preems
  raffinaderier r\u00e4knas till de mest moderna och milj\u00f6anpassade i Europa
  med en raffineringskapacitet p\u00e5 \u00f6ver 18 miljoner kubikmeter per \u00e5r.
  Vi f\u00f6r\u00e4dlar och s\u00e4ljer drivmedel, eldnings- och sm\u00f6rjolja samt
  andra produkter till f\u00f6retag och privatpersoner. Vi har ett rikst\u00e4ckande
  servicen\u00e4t med drygt 520 tankst\u00e4llen f\u00f6r privat- och yrkestrafik.
  Preem AB har cirka1 500 anst\u00e4llda varav 1 100 arbetar vid raffinaderierna.
  F\u00f6r hel\u00e5ret 2023 var Preems oms\u00e4ttning 138 miljarder SEK.\\nFotograf:
  Lena Lagerstr\u00f6m\\nF\u00f6rfattaren och f\u00f6rel\u00e4saren Peppe Ekmark gick
  mitt i karri\u00e4ren in i en djup depression, d\u00e4r han var n\u00e4ra att ta
  livet av sig. Men d\u00e4refter kom v\u00e4ndpunkten och han reste sig starkare
  \u00e4n n\u00e5gonsin. Nu sl\u00e4pper han sin debutroman Mannen som k\u00f6rde
  vilse i Toscana och hittade hem, som \u00e4r inspirerad av den sj\u00e4lvutvecklande
  resa han sj\u00e4lv gav sig ut p\u00e5. Med boken vill Peppe Ekmark belysa tabun
  kring m\u00e4n och psykisk oh\u00e4lsa, f\u00f6r att fler ska v\u00e5ga prata om
  sina k\u00e4nslor och s\u00f6ka hj\u00e4lp.\\n\u2013 Jag har haft f\u00f6rm\u00e5nen
  att f\u00e5 h\u00f6ra flera hundra m\u00e4nniskor ber\u00e4tta om sina egna livs\u00f6den,
  som p\u00e5minner om min egen. Dessa m\u00f6ten visar att m\u00e5nga m\u00e4nniskor
  \u00e4r mer eller mindre framg\u00e5ngsrika, har ett bra liv och ser ut att vara
  n\u00f6jda. Men n\u00e4r vi skrapar p\u00e5 ytan kommer sanningen fram. Jag har
  tagit mig friheten att dramatisera detta genom karakt\u00e4ren Rickard och alla
  de bekantskaper han m\u00f6ter. S\u00e5 med det sagt \u00e4r precis allt i boken
  sant, p\u00e5 ett eller annat s\u00e4tt. Min f\u00f6rhoppning \u00e4r att denna
  bok kan bli ett st\u00f6d f\u00f6r dem som befinner sig i en liknande situation
  som jag gjorde. Jag vill inspirera till att v\u00e5ga ta hj\u00e4lp och s\u00f6ka
  v\u00e4gledning, f\u00f6r att kunna ta ansvar f\u00f6r sitt liv och utforska vem
  man \u00e4r, vad man vill och vart man \u00e4r p\u00e5 v\u00e4g, s\u00e4ger Peppe
  Ekmark.\\nOm handlingen i boken:\\nHuvudpersonen Rickard har allt som p\u00e5 ytan
  ser perfekt ut: en framg\u00e5ngsrik reklambyr\u00e5, tv\u00e5 \u00e4lskade barn
  och en fantastisk partner i Sofia. Trots detta k\u00e4nner han sig inte lycklig.
  I ett f\u00f6rs\u00f6k att finna frihet och fylla tomrummet skiljer han sig och
  inleder en resa som f\u00f6r honom fr\u00e5n ett prestationsdrivet Stockholm till
  Toscanas rofyllda landskap. D\u00e4r, bland b\u00f6ljande kullar, god mat och genuina
  m\u00f6ten, f\u00e5r han insikter som f\u00f6r\u00e4ndrar hans liv f\u00f6r alltid.\\nEtt
  st\u00e4lle d\u00e4r jag ofta sitter och funderar p\u00e5 livet. Det g\u00f6r jag
  ganska ofta nuf\u00f6rtiden. Det \u00e4r bara det att jag aldrig kommer fram till
  n\u00e5got. Jag har mer och mer b\u00f6rjat fundera p\u00e5 meningen med livet.
  \u00c4r det verkligen meningen att livet inte ska vara n\u00e5got annat \u00e4n
  det h\u00e4r. G\u00e5 till jobbet p\u00e5 morgonen, jobba hela veckan f\u00f6r att
  sen supa till. Och s\u00e5 l\u00e4ngta till semestern som aldrig blir som man t\u00e4nkt
  sig.\\n\u2013 ur boken.\\nPeppe Ekmark \u00e4r talare, f\u00f6rfattare och utbildare
  inom f\u00f6rs\u00e4ljning, ledarskap och personlig utveckling. Med \u00f6ver 40
  \u00e5rs erfarenhet inom s\u00e4lj och ledarskap, har han tidigare gett ut b\u00f6ckerna
  S\u00e4lja bra eller s\u00e4lja b\u00e4st \u2013 hur du hittar nyckeln till kundens
  hj\u00e4rta och Leda bra eller leda b\u00e4st \u2013 8 steg som hj\u00e4lper dig
  att hitta nyckeln till b\u00e5de ditt och dina medarbetares hj\u00e4rta som b\u00e5da
  har blivit stora framg\u00e5ngar. Ekmark f\u00f6rel\u00e4ser om hur man genom att
  \u00e4ndra sitt tankes\u00e4tt kan hitta tillbaka till sig sj\u00e4lv. Han driver
  ocks\u00e5 sedan n\u00e5gra \u00e5r tillbaka kursg\u00e5rden Casa Oliveta i Toscana
  tillsammans med sin fru, d\u00e4r han h\u00e5ller i kurser i personlig utveckling.\\nISBN
