  har S\u00f6rmlands Sparbank slagit upp portarna till den nya lokalen i Prismanhuset
  i hj\u00e4rtat av Oxel\u00f6sund!\\nLokalen, som ligger i h\u00f6rnet av g\u00e5gatan
  och Torggatan mitt i stan, \u00e4r utformad f\u00f6r att passa den moderna bankkundens
  behov. H\u00e4r kan Oxel\u00f6sundsborna f\u00e5 hj\u00e4lp med s\u00e5v\u00e4l
  bank\u00e4renden som guidning till digitala tj\u00e4nster och finansiell r\u00e5dgivning
  f\u00f6r b\u00e5de privatpersoner och f\u00f6retag.\\nSatsningen p\u00e5 en ny lokal
  \u00e4r ett tydligt bevis p\u00e5 bankens \u00f6vertygelse om att en fysisk m\u00f6tesplats
  \u00e4r viktig f\u00f6r att kunna erbjuda b\u00e4sta m\u00f6jliga service och st\u00f6d
  till kunderna. N\u00e4r m\u00e5nga andra banker v\u00e4ljer att flytta sin service
  fr\u00e5n fysiska m\u00f6tesplatser till digitala kanaler, v\u00e4ljer sparbanken
  att finnas kvar med bankkontor som \u00e4r \u00f6ppna f\u00f6r b\u00e5de spontanbes\u00f6k
  och bokad r\u00e5dgivning. S\u00f6rmlands Sparbank \u00e4r sedan flera \u00e5r tillbaka
  den enda banken med kontor i Oxel\u00f6sund.\\n\u2013 Valet att forts\u00e4tta som
  fullservicebank i Oxel\u00f6sund var enkelt. H\u00e4r st\u00e5r d\u00f6rren \u00f6ppen
  f\u00f6r alla som vill ha r\u00e5dgivning och service p\u00e5 plats. Det digitala
  \u00e4r en sj\u00e4lvklar del av v\u00e5r verksamhet, men vi forts\u00e4tter ocks\u00e5
  att v\u00e4rna det fysiska m\u00f6tet och de personliga relationerna. Vi vet att
  efterfr\u00e5gan p\u00e5 fysiska banktj\u00e4nster fortfarande \u00e4r stor, s\u00e4ger
  vd S\u00f6ren Schelander.\\nDet bekr\u00e4ftas av en unders\u00f6kning som Sparbankernas
